import {buildQueryUrl} from './common'
export const getAllClients = () => {
    return [
        {   
            params: {
                id: 'casey'
            }
        },
        {   
            params: {
                id: 'brisbane'
            }
        },
    ]
}

export const getClientData = (clientName: string) => {
    const data = buildQueryUrl(clientName)
    return data
}
